import React from "react";
import { PieChart } from 'react-minimal-pie-chart';
import '../App.css';

const graphs = (props) => {
    const graphData = props.graphData;
    console.log(graphData);
    const keys = Object.keys(graphData);
    var totalSum;
    keys.forEach((key) => {
        totalSum += graphData[key].slight_delays;
    });
    return (
        <div>
            <PieChart data={[
             { title: 'Large Delays', value: totalSum, color: '#E38627' },
             { title: 'Moderate Delays', value: 15, color: '#C13C37' },
             { title: 'Small Delays', value: 20, color: '#6A2135' },
            ]} radius = {30}
            label={(props) => { return props.dataEntry.value;}} labelStyle={{
                fontSize: "10px",
                fontColor: "FFFFFA",
                fontWeight: "400",
              }}/>;
        </div>
    );
}
export default graphs;
